delete from stock_price_history sphwhere ( ctid) in     (SELECT         ctidfrom (    SELECT     ctid,        "Date",         "Open",         "High",        "Low",        "Close",       "Volume",       "symbol",        ROW_NUMBER() OVER (            PARTITION BY                 "symbol",                "Date"            ORDER BY                 "symbol",                "Date"                 ) row_num     FROM         stock_price_history ) t         where t.row_num >1);delete from stock_price_history sphwhere symbol in (select symbol from public.stock_price_history sphgroup by symbolhaving sum("Close") is null);